import { configureStore } from '@reduxjs/toolkit';
import postReducer from '../Utils/posts/PostsSlice';
import userReducer from '../Utils/client/userSlice';
export const store = configureStore({
  reducer: {
    posts: postReducer,
    users: userReducer,
  },
});
